import React from 'react';
import ReservedTravel from './ReservedTravel';

// Assuming this component receives the props passed from the navigation
const FinishedPage = ({ travelID, flight_ids, usedCompanies, visitedPlanets, flightDistance, flightDurationDays, flightCost, passengerFirstName, passengerLastName }) => {
    return (
        <div>
            <h1>Finished Page</h1>
            {/* Other content of finished page */}
            <ReservedTravel
                travelID={travelID}
                flight_ids={flight_ids}
                usedCompanies={usedCompanies}
                visitedPlanets={visitedPlanets}
                flightDistance={flightDistance}
                flightDurationDays={flightDurationDays}
                flightCost={flightCost}
                passengerFirstName={passengerFirstName}
                passengerLastName={passengerLastName}
            />
        </div>
    );
};

export default FinishedPage;
